  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sand Lake NWR
  and the easement refuges outlines Refuge accomplishments from May through August
  of 1945. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, mammals, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  plantings. Resource management is outlined; topics include grazing and haying. The
  public relations section of the report describes Refuge visitors, Refuge participation,
  and fishing. N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
